    private static void saveTest() {
        PlatformRegionCode regionCode = new PlatformRegionCode();
        regionCode.setId("2");
        regionCode.setPlatformType(19);
        regionCode.setParentID("1");
        regionCode.setName("北京");
        try {
            restTemplate.postForEntity(QUERY_MODIFIED_URL, new ArrayList<>(Arrays.asList(regionCode)), String.class);
        } catch (Exception e) {
            e.printStackTrace();
        }
        System.out.println("成功");
    }

    private static void parseArray(String json) {
        JSONArray jsonArray = JSON.parseArray(json);
        if (jsonArray == null || jsonArray.size() <= 0) return;
        List<PlatformRegionCode> regionCodeList = new ArrayList<>();
        platformRegionCodes(jsonArray, regionCodeList);
        for (List<PlatformRegionCode> sub : Lists.partition(regionCodeList, 100)) {
            restTemplate.postForEntity(QUERY_MODIFIED_URL, sub, String.class);
        }
        System.out.println("保存微店地区码个数:"+regionCodeList.size());
    }

    private static void platformRegionCodes(JSONArray jsonArray, List<PlatformRegionCode> regionCodeList) {
        for (int i=0; i<jsonArray.size(); i++) {
            JSONObject object = jsonArray.getJSONObject(i);
            platformRegionCode(object, regionCodeList);
        }
    }

    private static void platformRegionCode(JSONObject json, List<PlatformRegionCode> regionCodeList) {
        PlatformRegionCode regionCode = new PlatformRegionCode();
        regionCodeList.add(regionCode);
        String rID = (String) json.get("rID");
        String pID = (String) json.get("pID");
        String des = (String) json.get("des");
        regionCode.setId(rID);
        regionCode.setPlatformType(19);
        regionCode.setParentID(pID);
        regionCode.setName(des);
        if (json.containsKey("son")) {
            platformRegionCodes((JSONArray) json.get("son"), regionCodeList);
        } else {
            return;
        }
    }
